  {
   "cell_type": "markdown",
   "id": "b12ca147-56f3-463b-8f1f-f91f19dc33f6",
   "metadata": {},
   "source": [
    "- We got the lowest AIC value: 297.788 for ARIMA(1, 1, 1)x(1, 1, 0, 12). We shall use these best params in our model.\n",
    "\n",
    "- Here, the **Akaike information criterion (AIC)** is an estimator of the relative quality of statistical models for a given set of data. Given a collection of models for the data, AIC estimates the quality of each model, relative to each of the other models. Thus, AIC provides a means for model selection.\n",
    "\n",
    "- AIC estimates the relative amount of information lost by a given model: the less information a model loses (less AIC value), the higher the quality of that model."
   ]
  },
